// MyButton.tsx
import React from "react";

interface MyButtonProps {
  title: string;
  disabled?: boolean;
  onClick?: () => void;
  style?: React.CSSProperties; // <-- Add this
}

const MyButton: React.FC<MyButtonProps> = ({ title, disabled = false, onClick, style }) => {
  return (
    <button
      disabled={disabled}
      onClick={onClick}
      style={{
        padding: "10px 20px",
        fontSize: "16px",
        cursor: "pointer",
        borderRadius: "12px", // default rounded
        border: "none",
        backgroundColor: "#f2efedff",
        color: "black",
        ...style, // allow overrides
      }}
    >
      {title}
    </button>
  );
};

export default MyButton;
